    "In situ, meteorological, navigational, physical and profile data collected by
    US DOC; NOAA; NWS; National Data Buoy Center at OceanSITES site T0N155W from 1999-10-28
    to 2015-08-06 (NCEI Accession 0130055)",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-26T22:17:01.518750",nt"name": "in-situ-meteorological-navigational-physical-and-profile-data-collected-by-us-doc-noaa-nws-ae347",nt"isopen":
    false,nt"url": null,nt"notes": "In situ, meteorological, navigational,
    physical and profile oceanographic data were collected, including AIR TEMPERATURE,
    DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, PRECIPITATION RATE,
    RELATIVE HUMIDITY, SALINITY, SEA SURFACE TEMPERATURE, SIGMA-THETA, WATER TEMPERATURE,
    WIND DIRECTION and WIND SPEED from Moored Buoy at the TAO/TRITON Site 0N 155W (T0N155W)
    using GPS, anemometer, conductivity sensor, meteorological sensors, pressure sensors
    and thermistor from 1999-10-28 to 2015-08-06. These data were provided to one of
    the OceanSITES Data Assembly Centers (DAC). The DAC formatted this information into
    the OceanSITES file format and passed it on to the Global Data Assembly Centers
    (GDAC).OceanSITES is a worldwide system of long-term, open-ocean reference stations
    measuring dozens of variables and monitoring the full depth of the ocean from air-sea
    interactions down to the seafloor. It is a network of stations or observatories
    measuring many aspects of the ocean's surface and water column using, where possible,
    automated systems with advanced sensors and telecommunications systems, yielding
    high time resolution, often in real-time, while building a long record.",nt"license_title":
